import { Component } from "react";

class Login extends Component {

    render() {
        return (
            <div>
                <form>
                    <input type="text" placeholder="email"></input>
                    <br></br>
                    <input type="password" placeholder="password"></input>
                    <button>Save</button>
                </form>
            </div>

        )
    }
}

export default Login;
